import React from "react";

export class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  // Your event handlers
  render() {
    return (
      <div>
        <h1>{this.state.counter}</h1>
        <button type="button">Decrement</button>
        <button type="button">Increment</button>
      </div>
    );
  }
}
